function WorkPiece({ title, description }) {
  return (
    <div class="w-full pb-5 lg:pr-12">
      <div class="relative pb-2/3 bg-gray-200 rounded"></div>
      <h3 class="mt-6 mb-2 text-2xl font-bold">{title}</h3>
      <p class="text-2xl text-gray-900 leading-snug">{description}</p>
    </div>
  );
}

export default WorkPiece;
